import image1 from '../images/Bill_or_beak.jpeg'
import image2 from '../images/fried_chicken.jpg'
import image3 from '../images/noodle_soup.jpg'
import image4 from '../images/shawarma.jpg'

const imagesList = [
    {
        id: 1,
        src: image1,
        alt: "bill_or_beak",
    },
    {
        id: 2,
        src: image2,
        alt: "fried chicken",
    },
    {
        id: 3,
        src: image3,
        alt: "noodle_soup",
    },
    {
        id: 4,
        src: image4,
        alt: "shawarma",
    }
]

export default function Image() {
    return (
        <div>
          {imagesList.map((image) => (
            <img className='homeImage' key={image.id} src={image.src} alt={image.alt} />
          ))}
        </div>
      );
    }
